import ClearIcon from '../Icons/ClearIcon/ClearIcon';
import './Filter.css';

function Filter() {
  return (
    <div className="filter">
      <input type="text" className="filter_input" placeholder='Поиск по имени или e-mail'/>
      <div className="filter_clean">
        <ClearIcon/>


      </div>
    </div>
  );
}

export default Filter;
